    private async Task OnValueChanged(int? value)
    {
        try
        {
            Console.WriteLine(value);

            job.CityId = null;
            job.CountryId = value;
            var response = await Http.GetFromJsonAsync<PagedResponse<List<CityModel>>>($"city?CountryId={value??0}");
            if (response.Succeeded)
